import styled from "styled-components"

const ButtonStyled = styled.button`
    background-color: #FF4791;
    color: white;
    border: 1px solid #FF4791;
    border-radius: 8px;
    width: 298px;
    height: 52px;
    font-family: "roboto";
    font-weight: 700;
    font-size:14px;
    margin-bottom: 24px;
`
export default ButtonStyled
